import React from 'react';
import SearchBar from './SearchBar'
import SearchOptions from './SearchOptions'
import YearTabs from './YearTabs'

function NavBar() {
    return (
        <div>
            <YearTabs query={ PaymentResponse.query } setQuery={ PaymentResponse.setQuery }/>
            <SearchBar onSearch={ PaymentResponse.handleSearch } query={ PaymentResponse.query } setQuery={ PaymentResponse.setQuery }  isOptionShown={ PaymentResponse.isOptionShown } setIsOptionShown={ PaymentResponse.setIsOptionShown }/>
            <SearchOptions query={ PaymentResponse.query } setQuery={ PaymentResponse.setQuery } isOptionShown={ PaymentResponse.isOptionShown } setIsOptionShown={ PaymentResponse.setIsOptionShown }/>
        </div>
    );
}

export default NavBar;
